/****** Object:  View [dbo].[TeacherTotalAssignedCredit]    Script Date: 25-Dec-19 12:24:33 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [dbo].[TeacherTotalAssignedCredit]
AS
SELECT CA.TeacherId, SUM( C.CourseCredit) AS [TOTAL COURSE CREDIT] FROM Teacher AS T
JOIN TeacherCourseAssign AS CA 
ON CA.TeacherId = T.Id
JOIN Course AS C
ON C.Id = CA.CourseId
GROUP BY CA.TeacherId
