INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (4, N'ECO-102', N'Introduction to Macroeconomics', 5, N'This is the first course in Macroeconomics for the students of Economics major. This course is also required for BBA major students as an introduction to Macroeconomics. The aim of the course is to provide a non-technical introduction to the basic macroeconomic theory.', 6, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (5, N'ACT-201', N'Financial Accounting', 5, N'Accounting and its environments; Concepts and conventions of Accounting; Generally Accepted Accounting Principles; Accounting Equations; Recording business transactions; Accounting cycle; Accounting for a merchandising concern; Preparation of financial statements and Accounting for cash, receivables, inventories, fixed assets: acquisition, disposal and depreciation. Analyzing financial statements; implementing Accounting system: computerized Accounting.', 7, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (8, N'ACT-202', N'Management Accounting', 5, N'Cost concepts; Classification; Job Order Costing; Process Costing; Cost behavior analysis; Cost-volume-profit analysis; Variable Costing; Activity Based Costing; Budgeting; Cost control and performance appraisal; Flexible Budgets and Overhead Analysis; Segment reporting, Profitability analysis and decentralization; Responsibility Accounting and variance analysis.', 7, 1)
GO
