INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (10, N'ENG-091', N'Foundation Course', 5, N'The English Foundation Course is designed to enable students to develop their competence in reading, writing, speaking, listening and grammar for academic purposes. The students will be encouraged to acquire skills and strategies for using language appropriately and effectively in various situations. The approach at all times will be communicative and interactive involving individual, pair and group work. ', 9, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (11, N'ENG-101', N'English Fundamentals', 5, N'Drills in basic writing skills: mechanics, spelling, syntax, grammar review, sentence and essay writing. Required of all First Year students. ', 9, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (12, N'ENG-102', N'Composition I', 5, N'The main focus of this course is writing. This course attempts to enhance students'' writing abilities through diverse writing skills and techniques. Students will be introduced to two aspects of expository writing: personalized/subjective and analytical/persuasive. In the first category, students will write essays expressing their subjective viewpoints. In the second category, students will analyse issues objectively, sticking firmly to factual details. ', 9, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (13, N'ENG-106', N'English Fundamentals for Architecture', 5, N'The main objectives of the course include: Developing effective and efficient reading, writing, listening and speaking strategies and techniques, increasing students'' repertoire of vocabulary, reading with speed and understanding, writing standard, well- informed academic essays, enhancing spoken fluency.', 9, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (14, N'ENG-111', N'Principles of Linguistics', 5, N'The course aims to familiarize students with basic concepts in linguistics including phonetics; phonology; morphology, syntax and semantics. Other aspects of this course will include definition and characteristics of language; role of linguistics in language teaching, relationship between linguistics and literature; second language acquisition and second language learning.', 9, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (15, N'ENG-113', N'Introduction to English Poetry', 5, N'Study of selected English poems from Shakespeare to contemporary times; Analysis of Poems; Prosody; Poetic Genres.', 9, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (16, N'ENG-114', N'Introduction to English Drama', 5, N'Study of selected plays from Shakespeare to Pinter; Analysis of Drama; Poetics and Fundamentals of Drama; Dramatic Forms.', 9, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (17, N'ENG-115', N'Introduction to English Prose', 5, N'Study of selected English Fictional and Non-Fictional Prose from Swift to contemporary times; Analysing Prose, Prose Forms.', 9, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (18, N'ENG-122', N'English Phonetics and Phonology', 5, N'This course is designed to promote a comprehensive study of English articulatory phonetics that deals with the production of English speech sounds. It intends to develop students'' skills in perceiving, articulating and transcribing speech sounds. It also focuses on segments, syllables, stress, intonation and functions of intonation that are segmental and supra-segmental features. On the one hand, the practical aim of this course is to help students pronounce English accurately and on the other hand, its theoretical aim is to give students a deeper understanding of the sound system of English.', 9, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (19, N'ENG 123', N'History of English Language', 5, N'This course will familiarize students with the evolution and development of English Language; its current practices, and forces responsible for giving it the shape it is in', 9, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (20, N'ENG-203', N'Communication Skills in Architecture', 5, N'This course is designed to strengthen students'' communication skills, that they need to perform successfully in academic and non-academic fields. It will be a laboratory-based course. Audio visual aids in the laboratory will facilitate speaking as well as listening accuracy. In this course, students will participate in discussions', 9, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (21, N'ENG-211', N'Sociolinguistics', 5, N'This course is the study of language as a social factor. The study takes into account regional and social dialects along with standard language, the process of standardization and pidgin and Creole languages. It also focuses on how language functions in society and deals with bilingualism, multilingualism, diglossia, code switching, register, and style. ', 9, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (22, N'ENG 212', N'Psycholinguistics', 5, N'This course examines stage by stage acquisition of phonology, morphology, syntax and semantics of the child''s first language. In other words, it aims to provide students with the knowledge of the earliest stages of a child language acquisition; development of the child''s sound system i.e. how children perceive and produce the sounds of their language; the acquisition of language structure emphasizing the principles children apply in this regard and the acquisition of meaning along with their awareness of the form and function of speech acts.', 9, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (23, N'ENG 213', N'Survey of English Literature I', 5, N'Chaucer to Donne: Intensive Study of Chaucer, Spencer, Marlowe, Shakespeare, Webster, Jonson, Bacon, John Donne.', 9, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (24, N'ENG 214', N'Survey of English Literature II', 5, N'Milton to Johnson: Intensive Study of Milton, Dryden, Swift, Defoe, Pope, Fielding and Dr. Johnson.', 9, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (25, N'Shakespeare', N'ENG-217', 5, N'An introduction to the plays of Shakespeare (history, comedy, tragedy, and romance). The plays will be studied in the context of Renaissance thought and will explore issues such as politics, religion, family, gender, historical settings and theatrical performances.', 16, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (26, N'ENG 218', N'Post-Colonial Writing in English', 5, N'This course will look at the vast body of contemporary writing in English from ex-colonial countries. Possible authors are Salman Rushdie, Ngugi ''waThiong''o, Amitav Ghosh, Chinua Achebe, Derek Walcott.', 9, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (27, N'ENG 221', N'Discourse Analysis', 5, N'This course explores the structure and social context of texts both written and spoken language. Attention is focused on the structure and function of language beyond the sentence i.e. the way in which spoken (discourse) and written language (text) is used in coherent and meaningful ways (pragmatics).', 9, 8)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (28, N'ENG-232', N'History of English Language Teaching', 5, N'This course is designed to review the history of English language teaching. It covers the spread of English language teaching in Europe, and gives an overview of English language teaching since 1900 and the teaching of English as a foreign or second language since 1900, including foundations, development, changes and variations that took place in ELT.', 9, 9)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (29, N'ENG-241', N'Later Eighteenth-Century Literature', 5, N'A selection from works by Johnson, Boswell and Sterne, together with shorter samplings from Gray, Burke, Goldsmith, Burney, Reynolds, Wollstonecraft, and others.', 9, 9)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (30, N'ECO-201', N'Mathematics for Business and Economics', 5, N'The objective of this course is to provide an introduction to mathematical tools and techniques that are frequently used in microeconomics, macroeconomics, finance, and operations.
', 6, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (31, N'ECO-308', N'International Trade', 5, N'Theories of absolute and comparative advantages; Heckscher-Ohlin and Factor Price Equalization Theorems; Offer Curves and Gains from Trade; Economies of Scale and New International Trade Theories; Industrial-Organization based trade models; The theory of protection; Export promotion & import substitution policies; Custom Unions, Regional co-operation, WTO.', 6, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (32, N'ECO-310', N'History of Economic Thought', 5, N'Birth of political economy; Mercantilism and Classical economics: Smith, Malthus, Ricardo, Mill; Socialist thought and Marx; Marshall and the Marginal Revolution; Keynes and the Keynesian revolution; Neoclassical synthesis and economic growth; Theory of general equilibrium and welfare economics; Value, distribution and role of the state.', 6, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (33, N'ECO-311', N'Economic Growth and Development', 5, N'This course provides an introduction to Micro and Macroeconomic theories of economic growth and their development aspects.', 6, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (34, N'ECO-324', N'Bangladesh Economy', 5, N'This course analyzes the economic features and macroeconomic performance of the economy of Bangladesh.', 6, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (35, N'ECO-431', N'International Finance and Economic Policy', 5, N'Balance of payments, economics and accounting; Partial and General equilibrium models of exchange rate determination; Interest rate parity and purchasing power parity theory; Role of monetary and fiscal stabilization policies in open economies; International debt problems; Role of international financial institutions in developed and developing economies.', 6, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (36, N'ECO-432', N'Money and Banking', 5, N'Role of money in the economy and its impact on output, employment, and prices; Types of financial assets and their uses, stock and bond markets; Money and credit multipliers; Banking system of Bangladesh; Various monetary policies and their effectiveness; Central banking, credibility, rules, discretion.', 6, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (37, N'ECO-301', N'Microeconomic Analysis', 5, N'The objective of this course is to provide an advanced treatment of standard microeconomic theories. The course is aimed at students who are planning to pursue graduate studies in economics.', 6, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (38, N'ECO-302', N'Macroeconomic Analysis', 5, N'The objective of this course is to provide an advanced treatment of standard macroeconomic theories. The course is aimed for students who are planning to pursue graduate studies in economics.', 6, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (39, N'ECO 304', N'Agricultural Economics', 5, N'Introduction of agriculture as an industry; Economics of agricultural production, farm management; Land economics, rural organization; Agricultural credit and finance; Agricultural marketing; Agricultural law, agrarian reform and agricultural policies; Agricultural prices and government policy.', 6, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (40, N'ECO-305', N'Labour Economics', 5, N'The main objective of the course is to provide a survey of key issues in contemporary labour economics.', 6, 8)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (41, N'ECO 307', N'Mathematical Methods for Economics', 5, N'ntroductory Linear Algebra-Matrices, Eigenvalues, Vector Spaces; Comparative Static analysis and applications; Non-Linear Programming: Optimization with inequality constraints; Integration, Differential equations and their application to economics; Introduction to Dynamic programming.', 6, 8)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (42, N'ACT-301', N'Intermediate Accounting', 5, N'The course deals with measurement and reporting of financial condition of business firms and with Accounting principles and process of different types of assets, liabilities and equities. Topics include environment of Accounting, generally Accepted Accounting principles, Accounting cycle, income measurement and reporting, financial reports, inventory valuation and Accounting, plant assets acquisition, depreciation and depletion, current liabilities', 7, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (43, N'ACT-422', N'Cost Accounting', 5, N'The course will cover Cost concept, classification and statements; Costing and control of materials; Costing and control of labors; Costing and control of manufacturing overhead; Service department cost allocation; Activity based costing; Job order cost system; Process costing-Weighted average and FIFO method, Accounting for spoilage; Joint product and by-product costing; Standard costing; Target costing', 7, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (44, N'ACT-425', N'Principles of Auditing', 5, N'An introduction to auditing practice. Includes the social role of auditing and the services offered by auditors in internal, governmental, and public Accounting practice. Emphasis is on the financial auditing process, including professional ethics, audit risk assessment, study and evaluation of internal control, gathering and evaluating audit evidence, and audit reporting decisions.', 7, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (45, N'ACT 423', N'Fundamentals of Taxation', 5, N'Topics include Income Tax: Definition of income and income tax, Characteristics of income, Total income and total world income, Income year and assessment year, Role of income tax law in.Industrial development of Bangladesh; Classification of income; Heads of income; Tax assessment and recovery assessment procedure; Income tax authorities; Assessment of individuals, partnership and public limited companies; Value Added Tax: Assessment and payment of tax, Valuation, Accounting, Refunds, Drawback, Calculation of VAT, Controlling evasion', 7, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (46, N'ACT-421', N'Accounting Information Systems (AIS)', 5, N'The course covers Overview of Accounting information system; Organization and the Accounting system; Accounting information processing; Accounts system development; System analysis and acquisition; Computers and AIS; Software; Data communication; Database and file oriented systems; Control of AIS; Revenue cycle; Personnel cycle; Cash receipt and disbursement; Capital asset and financial statements.', 7, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (47, N'ACT 431', N'Advanced Accounting', 5, N'The course deals with the conceptual framework of Accounting; Lease Accounting; Installment and hire-purchase, Single entry system; Consignment; Joint venture; Mergers, acquisitions and amalgamations; Insolvency Accounting; Accounting for VAT, tariffs, duties.', 7, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (48, N'ACT-432', N'International Accounting', 5, N'The globalization of markets, both financial and physical, has increased the importance of understanding the international dimensions of corporate Activities. The course will give students the opportunity to learn about diverse financial reporting practices and the reasons for such diversities as well as applying this knowledge in the context of the review and analysis of firm''s performance by analysts, investors, and managers. At a corporate level, the course will also offer an appreciation of the significance of foreign exchange and of the tools and techniques for the management of its risks.', 7, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (49, N'ACT-434', N'Accounting for Specialized Institutions', 5, N'The course will cover Accounting practice of specialized organizations such as banks, NGOs, Development Organizations, Government Agencies etc.', 7, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (50, N'BUS-201', N'Business and Human Communication', 5, N'This course aims to teach the theory and process of communication; including barriers to effective communication; communication skills; letters, memos and reports writing; oral communication; listening; use of visual aids in communication; and use of non-verbal communication, and effective business meeting behaviour.', 7, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (51, N'BUS-202', N'Business Law', 5, N'A study of legal environment of business in Bangladesh, Includes both commercial and industrial laws. Law of Contract; Sale of Goods ACT; Law of Agencies; Bailment; Law of Carriage of Goods; Negotiable Instruments ACT, Law of Insurance; Company Law. Industrial ordinance.', 7, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (52, N'BUS 203', N'Business Environment', 5, N'A study of economic, social, cultural, political, legal and technological factors affecting business in local, national and global context. Relationship between business and Government and between business and society are also examined. The focus of the course is on issues management and identification of strategic options .The course involves learning tools and techniques for monitoring, identification and analysis of major environmental factors affecting business and assessing their impact on business decisions.', 7, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (53, N'BUS-301', N'International Business', 5, N'International business and environment; International trade theories; Introduction to international finance, economics and marketing; International communication and promotion; Mergers and acquisitions; International organizations and regulatory bodies. National and sub regional trade; bilateral and multilateral trade arrangements; Global business strategy and International law.', 7, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (54, N'BUS -302', N'Research Methods in Business and Management', 5, N'Research and management; Scientific thinking; Research process and design; Measurement and scaling; Sampling design; Data collection methods; Survey instrument design; Field administration, Analysis and research communications.', 7, 8)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (55, N'BUS-321', N'Principles of Entrepreneurship', 5, N'Entrepreneurship and theory; Impact of environmental variables on entrepreneurial success; Informal sector; Opportunity identification and assessment; Formulating business, financial and marketing plans; entrepreneurial start-up strategies; Operating the business; Legal issues and Ethics and social responsibility of the entrepreneur.', 7, 8)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (56, N'BUS-421', N'Venture Development', 5, N'Entrepreneurship and theory; Impact of environmental variables on entrepreneurial success; Informal sector; Opportunity identification and assessment; Formulating business, financial and marketing plans; entrepreneurial start-up strategies; Operating the business; Legal issues and Ethics and social responsibility of the entrepreneur.', 7, 8)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (57, N'BUS-422', N'Small Business Management', 5, N'The course aims at providing knowledge of the requisites for successful management of small business. The course aims to develop the students'' understanding of the economic, social and political environment within which the small business functions and to provide him with knowledge on how to avoid business failures & build up a highly profitable and growing enterprise.', 7, 8)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (58, N'BUS-423', N'Business Plan Development', 5, N'The course is a project work based on field studies. The students are required to search and select a potential business idea, collect all pertinent data, conduct feasibility studies, formulate business and functional strategies and develop a full-fledged business plan.', 7, 9)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (59, N'FIN-301', N'Financial Management', 5, N'This is the introductory course in finance and covers the basic tools and techniques of making financial decisions. Major topics include financial market and securities, financial statements and their analysis using financial ratios, time value of money', 7, 9)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (60, N'FIN-422', N'Project Appraisals and Management', 5, N'The course deals with project identification, preparation, appraisal, management of implementation and post project evaluation. Basic techniques like network analysis, organization and control aspects of project implementation in relation to resources, time scale and information processing are emphasized.', 7, 9)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (61, N'CSE-110', N'Programming Language', 5, N'This course would be an introduction to the foundations of computation and purpose of mechanized computation. Emphasis will be placed on techniques of problem analysis and the development of algorithms and programs. ', 10, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (62, N'CSE-220', N'Data Structures ', 5, N'ntroduction to widely used and effective methods of data organisation, focussing on data structures, their algorithms and the performance of these algorithms. Concepts and examples, elementary data objects, elementary data structures, arrays, lists, stacks, queues, graphs, trees, compound structures, data abstraction and primitive operations on these structures. memory management; sorting and searching; hash techniques; Introduction to the fundamental algorithms and data structures: recursion, backtrack search, lists, stacks', 10, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (63, N'CSE-221', N'Algorithms', 5, N'The study of efficient algorithms and effective algorithm design techniques. Techniques for analysis of algorithms, Methods for the design of efficient algorithms :Divide and Conquer paradigm, Greedy method, Dynamic programming, Backtracking, Basic search and traversal techniques, Graph algorithms, Elementary parallel algorithms, Algebraic simplification and transformations, Lower bound theory, NP-hard and NP-complete problems. Techniques for the design and analysis of efficient algorithms', 10, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (64, N'CSE-230', N'Discrete Mathematics', 5, N'Set theory, Elementary number theory, Graph theory, Paths and trees, Boolean Algebra, Binary Relations, Functions, Algebraic system, Generating functions, Induction, Reduction, Semigroup, Permutation groups, Discrete Probability, Mathematical logic, Prepositional calculus and Predicate calculus.', 10, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (65, N'CSE-250', N'Circuits and Electronics', 5, N'Fundamental electrical concepts and measuring units. Direct current: voltage, current, resistance and power. Laws of electrical circuits and methods of network analysis; Introduction to magnetic circuits. Alternating current: instantaneous and r.m.s. current, voltage and power, average power for various combinations of R, L and C circuits, phasor representation of sinusoidal quantities. The course includes a compulsory 3 hour laboratory work alternate week.', 10, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (66, N'CSE-251', N'Electronic Devices and Circuits', 5, N'Introduction to semiconductors, p-type and n-type semiconductors; p-n junction diode characteristics; Diode applications: half and full wave rectifiers, clipping and clamping circuits, regulated power supply using zener diode.Bipolar Junction Transistor (BJT): principle of operation, I-V characteristics; Transistor circuit configurations (CE, CB, CC), BJT biasing, load lines; BJTs at low frequencies; Hybrid model, h parameters, simplified hybrid model; Small-signal analysis of single and multi-stage amplifiers, frequency response of BJT amplifier. Field Effect Transistors (FET): principle of operation of JFET and MOSFET; Depletion and enhancement type NMOS and PMOS; biasing of FETs; Low and high frequency models of FETs, Switching circuits using FETs', 10, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (67, N'CSE 260', N'Digital Logic Design ', 5, N'An introduction to digital systems such as computer, communication and information systems. Topics covered include Boolean algebra, digital logic gates, combinational logic circuits, decoders, encoders, multiplexers. Asynchronous and synchronous counters. Registers, flip-flops, adders, Sequential circuit analysis and design. Simple computer architecture. The course includes a compulsory 3 hour laboratory work each week.', 10, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (68, N'CSE-320', N'Data Communications', 5, N'Introduction to purpose and methods of communication. Necessity for modulation and techniques. Technical aspects of data communications. Effects of noise and control. Basic concepts such as fundamental limits, encoding, modulation, multiplexing, error detection and control. Topics include: Data Transmission Protocols, different layers in data communication systems, LANs, WANs linked with telephony.', 10, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (69, N'CSE-321', N'Operating Systems', 5, N'Principles of operating systems: design objects; sequential process; concurrent processes, functional mutual exclusion, processor co-operation and deadlocks, management. Control and scheduling of large information processing systems. Dispatching processor access methods, job control languages memory addressing, paging and store multiplexing, and time sharing', 10, 9)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (70, N'CHE-110', N'Principles of Chemistry', 5, N'Atomic structure, quantum theory. Atomic spectrum of hydrogen and the Bohr model for electron orbits and energy levels, quantum numbers. Electronic configuration, periodic table, valence. Chemical bonding and molecular structure. Chemical formulas and equations, oxidation and reduction. Gas laws, ideal gas equation, kinetic theory of gases. Thermochemistry, chemical kinetics and chemical equilibria. Different types of solutions, their properties, strengths. Acids and bases', 11, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (71, N'ENG-103', N'English Composition', 5, N'The main focus of this course is writing. The course attempts to enhance students’ writing abilities through diverse writing skills and techniques. Students will be introduced to aspects of expository writing: personalized/ subjective and analytical/persuasive. In the first category, students will write essays expressing their subjective viewpoints. In the second category students will analyze issues objectively', 11, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (72, N'HUM-103', N'Ethics and Culture', 5, N'This course introduces the students to principles and concepts of ethics and their application to our personal life. It establishes a basic understanding of social responsibility, relationship with social and cultural aspects, and eventually requires each student to develop a framework for making ethical decision in his work. Students learn a systematic approach to moral reasoning. It focuses on problems associated with moral conflicts', 11, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (73, N'DEV-101', N'Bangladesh Studies', 5, N'Socio-economic profile of Bangladesh, agriculture, industry, service sector, demographic patterns, social aid and physical infrastructures. Social stratification and power, power structures, government and NGO activities in socio-economic development, national issues and policies and changing society of Bangladesh.', 11, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (74, N'MAT-120', N'Mathematics II', 5, N'Integral Calculus: Definitions of integration. Integration by the method of substitution. Integration by parts. Standard integrals. Integration by method of successive reduction. Definite integrals, its properties and use in summing series. Walli''s formula. Improper integrals. Beta function and Gamma function. Area under a plane curve in Cartesian and polar coordinates. Area of the region enclosed by two curves in Cartesian and polar coordinates. Trapezoidal rule. Simpson''s rule. Arc lengths of curves in Cartesian and polar coordinates, parametric and pedal equations. Intrinsic equations. Volumes of solids of revolution. ', 11, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (75, N'PHY-112', N'Principles of Physics II', 5, N'Electric charge, Coulomb’s Law, electric field & flux density, Gauss’s Law, electric potential, capacitors, steady current, ohm’s law, Kirchhoff’s Laws. Magnetic field, Biot-Savart Law, Ampere’s Law, electromagnetic induction, Faraday’s Law, Lenz’s Law, self inductance and mutual inductance, alternating current, magnetic properties of matter, diamagnetism, paramagnetism and ferromagnetism. Maxwell’s equations of electromagnetic waves', 11, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (76, N'ECE-201', N'Electrical Circuits I', 5, N'Circuit variables and elements: Voltage, current, power, energy, independent and dependent sources, resistance. Basic laws: Ohm’s law, Kirchhoff’s current and voltage laws. Simple resistive circuits: Series and parallel circuits, voltage and current division, Wye-Delta transformation. Techniques of circuit analysis: Nodal and mesh analysis including supe rnode and super mesh. Network theorems: Source transformation', 11, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (77, N'ECE-202', N'Electrical Circuits I Laboratory', 5, N'In this course, students will perform experiments to verify practically the theories and concepts learned in ECE 201 and will design simple systems. The students will learn the basics of electrical CAD tools in designing these simple systems.', 11, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (78, N'ECO-105', N'Fundamentals of Economics', 5, N'Fundamental concepts in microeconomics and macroeconomics. Basic elements of consumer choice, demand and supply, product ion and cost , market structure. National income accounting, growth, unemployment and inflation, money and interest rate. Fiscal policy and monetary policy, economic growth and development. comparative advantage, foreign exchange and balance of payments, globalization.', 11, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (79, N'CSE-162', N'Computer Programming Laboratory', 5, N'n this course, students will perform experiments to verify practically the theories and concepts learned in CSE 161 and will learn program design and coding.', 11, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (80, N'ECE-204', N'Electrical Circuits II Laboratory', 5, N'In this course, students will perform experiments to verify practically the theories and concepts learned in ECE 203 and will design simple systems. The students will make use of electrical CAD tools in designing these systems.', 11, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (81, N'ECE-206', N'Electronics Devices and Circuits I Laboratory', 5, N'In this course, students will perform experiments to verify practically the theories and concepts learned in ECE 205 and will design simple systems. The students will learn the basics of electronic CAD tools in designing these simple systems.', 11, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (82, N'ECE-209', N'Semiconductor Devices and Materials', 5, N'Semiconductors in equilibrium: Energy bands, intrinsic and extrinsic semiconductors, Fermi levels, carrier concentrations, temperature dependence of carrier concentrations and invariance of Fermi level. Carrier transport processes and excess carriers: Drift and diffusion, generation and recombination of excess carriers and quasi-Fermi levels, built-in-field, Einstein relations, continuity and diffusion equations. PN junction at equilibrium: depletion region and depletion width, built-in electric field, contact potential, and the band diagram.', 11, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (83, N'ENV-103', N'Elements of Environmental Sciences', 5, N'Fundamental concepts and scope of environmental science, Earth''s atmosphere, hydrosphere, lithosphere and biosphere, men and nature, technology and population, ecological concepts and ecosystems, environmental quality and management, agriculture, water resources, fisheries, forestry and wildlife, energy and mineral energy sources; renewable and non renewable resources, environmental degradation; pollution and waste management, environmental impact analysis, remote sensing and environmental monitoring.', 11, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (84, N'ECE-241', N'Electromagnetic Fields and Waves', 5, N'Electromagnetic waves: Electric field and related theories, Electric potential, Solution of the field equations, Solution for free-space conditions, Solutions of Laplace’s equation, Capacitance, Numerical problems, Magnetic field and related theories, Internal and external impedances, Stored energy of electric and magnetic field, Application of electric flux: basic idea about transformer, Maxwell’s equation and its application, Solution of Maxwell’s equation, velocities of propagation, Surface impedance and depth of penetration, Characteristic impedance, Polarization, Uniform plane wave propagation and reflection', 11, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (85, N'MGT-211', N'Principles of Management ', 5, N'Meaning and importance of Management; Evolution of Management thoughts; Managerial decision making; Environmental impact Accounting treatment of price level changes; on management; Corporate social responsibility, Planning; Setting objectives; Implementing plans; Organizing; Organization design, Managing change; Directing; Motivation; Leadership; Managing work groups; Controlling: principles, process and problems and Managers in changing environment.', 11, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (86, N'STA-201', N'Elements of Statistics and Probability', 5, N'Frequency distribution, mean, median, mode and other measures of central tendency, standard deviation and other measures of dispersion, moments, skewness and kurtosis, elementary probability theory and discontinuous probability distribution, binomial, Poisson and negative binomial distribution, continuous probability distributions, normal and exponential, characteristics of distributions, hypothesis testing and regression analysis, basic concepts and applications of probability theory and statistics, chi-squared test.', 11, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (87, N'ECE-243', N'Signals and Systems', 5, N'Classification of signals and systems: signals - classification, basic operation on signals, elementary signals, representation of signals using impulse function; systems – classification. Properties of Linear Time Invariant (LTI) systems: linearity, causality, time invariance, memory, stability, invertibility. Time domain analysis of LTI systems: Differential equations - system representation, order of the system, solution techniques, zero state and zero input response, system properties; impulse response - convolution integral, determination of system properties; state variable - basic concept, state equation and time domain solution. Frequency domain analysis of LTI systems: Fourier series- properties, harmonic representation', 11, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (88, N'CSE 310', N'Object Oriented Programming', 5, N'An introduction to object oriented programming using. Java is the language typically used to illustrate the concepts, but another suitable language may be substituted by the instructor. Topics covered include object instances, classes, inheritance, polymorphism and abstraction mechanism. Problem domain analysis and system design using object oriented approach. Object oriented database and object persistency. Software principles for object oriented approach. Advantages and problems with using object oriented approach to developing systems. The course includes a compulsory 3 hour laboratory work each week.', 10, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (89, N'CSE-330', N'Numerical Methods ', 5, N'Computer Arithmetic: floating point representation of numbers, arithmetic operations with normalized floating point numbers; Iterative methods: different iterative methods for finding the roots of an equation and their computer implementation; Solution of simultaneous Algebraic Equations, Gauss elimination; Interpolation, Least square approximation of functions, Taylor series representation, Chebyshev series; Numerical differentiation and integration and Numerical Solution of Differential Equations.', 10, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (90, N'CSE-331', N'Automata and Computability ', 5, N'An introduction to finite representation of infinite objects and basic mathematical models of computation. Finite automata and regular languages, pushdown automata and context free languages. Turing machines. Church''s Thesis. Partial recursive functions. Undecidability. Reducibility and completeness. Halting problem. Time complexity and NP-completeness. Probabilistic computation. Interactive proof systems.', 10, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (91, N'CSE-340', N'Computer Architecture', 5, N'A systematic study of the various elements in computer design, including circuit design, storage mechanisms, addressing schemes, and various approaches to parallelism and distributed logic. Information representation and transfer; instruction and data access methods; the control unit; hardware and microprogrammed; memory organisation. RISC and CSEC machines.', 10, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (92, N'CSE-342', N'Computer System Engineering', 5, N'Topics on the engineering of computer software and hardware systems: techniques for controlling complexity; networks and distributed systems; atomicity and coordination of parallel activities; recovery and reliability; privacy of information; impact of computer systems on society. Case studies of working systems and outside reading in the current literature provide comparisons and contrasts.', 10, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (93, N'CSE-350', N'Digital Electronics and Pulse Techniques', 5, N'Diode logic gates, transistor switches, transistor gates, MOS gates, Logic families: TTL, ECL, IIL and CMOS logic with operation details. Propagation delay, product and noise immunity. Open collector and High impedance gates. Electronic circuits for flip flops, counters and register, memory systems. PLA''s (A/D, D/A converters with applications, S/H circuits) LED, LCD and optically coupled oscillators. Non-linear applications of OPAMPs. Analog switches. Linear wave shaping: diode wave shaping techniques, clipping and clamping circuits, comparator circuits, switching circuits. Pulse transformers, pulse transmission. Pulse generation:monostable', 10, 5)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (94, N'CSE-360', N'Computer Interfacing', 5, N'Interface components and their characteristics, micro processor I/O. Disk, Drums and Printers. Optical displays and sensors. High power interface devices, transducers, stepper motors and peripheral devices. The course includes a compulsory 3 hour laboratory work alternate week.', 10, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (95, N'PHY-111', N'Principles of Physics', 5, N'Vectors and scalars, unit vector, scalar and vector products, static equilibrium, Newton’s Laws of motion, principles of conservation of linear momentum and energy, friction, elastic and inelastic collisions, projectile motion, uniform circular motion, centripetal force, simple harmonic motion, rotation of rigid bodies, angular momentum, torque, moment of inertia and examples, Newton’s Law of gravitation, gravitational field', 17, 9)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (96, N'EEE-202', N'Electrical Circuits Laboratory', 5, N'In this course, students will perform experiments to verify practically the theories and concepts learned in EEE 201 and will design simple systems. The students will learn the basics of electrical CAD tools in designing these simple systems.', 17, 8)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (97, N'CSE-103', N'Introduction to Computing', 5, N'Introduction to computers. Introduction to basic word processing and spreadsheet programs. Internet and information access. HTML Basic graphics', 15, 6)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (98, N'ENG-108', N'English Fundamentals for ArchitectureEnglish ', 5, N'The main objectives of the course include: Developing effective and efficient reading, writing, listening and speaking strategies and techniques, increasing students'' repertoire of vocabulary, reading with speed and understanding, writing standard, well- informed academic essays, enhancing spoken fluency.', 15, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (99, N'LAW -04', N'Constitutional Law', 5, N'Introduction-Conception and elements of State-Definition, scope and nature of Constitutional Law-contents and classification of Constitutions. General theories of Constitution-classification of Constitutions, Supremacy of the Constitutions. Conventions of the Constitution-Ministerial responsibility-Sovereignty of Parliament-Theory of separation of powers-Rule of Law compared with Administrative judiciary. Fundamental Rights and Principles-Fundamental Principles of State Policy and their purpose. ', 17, 2)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (100, N'LAW-201', N'Equitable Principles and Specific Relief', 5, N'The course covers the origin and development of equity, equity and its relation to law, equity under Roman legal system, incorporation of Equitable principles in Bangladesh legal system, the general nature of equitable principles and remedies. The maxims of equity, election, satisfaction, redemption, equitable relief in contracts. Recovery of possession of immovable property, suit by person dispossessed', 17, 1)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (101, N'ENG-092', N'English Fundamentals for Literature', 5, N'Foundation', 9, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (102, N'ANT-103', N'Biological Anthropology', 5, N'This course aims to introduce the field of Biological Anthropology to undergraduate students. A significant part of the course will focus on the methodology of Biological Anthropology. It will also address the principles of evolution and genetics; population variation among modern human; understanding Homo sapiens as a species belonging to the class mammalian and the similarity between humans and other primate species.', 18, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (103, N'ANT-202', N'Social Inequality', 5, N'This course examines the different dimensions of social inequality and power. It focuses on income inequality, status inequality, racial, gender and ethnic inequalities and so on both from historical and theoretical perspectives. A wealth of information and empirical evidence are used to explain the different definitions, dimensions and approaches to the study of social inequality and stratification. In addition, it critically looks at different theoretical explanations for causes and persistence of inequality and implications of inequality for society.', 18, 3)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (104, N'ANT-203', N'Social Theory', 5, N'This course will introduce students with the classical and contemporary theories in the social sciences. It aims to inculcate in the student. A critical understanding of various schools of thought existing in Sociology and Anthropology, along with the different social and political contexts in which different thinkers carved out different ways of studying and thinking about society. The first half of the semester will focus on classical thinkers like Karl Marx', 18, 4)
GO
INSERT [dbo].[Course] ([Id], [CourseCode], [CourseName], [CourseCredit], [CourseDetails], [DepartmentId], [SemesterId]) VALUES (105, N'ARC-293', N'Music Appreciation', 5, N'Musical form. Ingredients of music: sound and time. Indian and Western music: melody and harmony. Foundations of sub-continental music: raga system. Presentation of vocal and instrumental music. Modern Bengali music and works of major composers and demonstrations. Western classical music and works of major composers. Music and its rhythm, composition etc.Musical form. Ingredients of music: sound and time. Indian and Western music: melody and harmony. Foundations of sub-continental music: raga system. Presentation of vocal and instrumental music. Modern Bengali music and works of major composers and demonstrations. Western classical music and works of major composers. Music and its rhythm, composition etc.', 19, 2)
GO
